import React from 'react'

class Test extends React.Component {
  constructor()
  {
    super()
    this.state = {
      greeting: 'Hello Vistors!'
    }
  }
  render(){
    return (
      <div>
        <h1>{this.state.greeting}</h1>
        <button onClick={() => this.change}>Click Me!</button>
      </div>
    )
  }

}

export default Test
